	const chalk = require("chalk");
  const gradient= require("gradient-string");
  const crayon = gradient('yellow', 'lime', 'green');
  const kushal = gradient('lime','yellow');
  const sky = gradient('#3446eb', '#3455eb', '#3474eb');

	//////////////////////////////////////////////////////////////////////
	//========= Push all variable from database to environment =========//
	//////////////////////////////////////////////////////////////////////
	
	(async function () {
		try {
      const process = require("process");
			const [threads, users] = await Promise.all([Threads.getAll(), Users.getAll(['userID', 'name', 'data'])]);
			threads.forEach(data => {
				const idThread = String(data.threadID);
				global.data.allThreadID.push(idThread);
				global.data.threadData.set(idThread, data.data || {});
				global.data.threadInfo.set(idThread, data.threadInfo || {});
				if (data.data && data.data.banned) {
					global.data.threadBanned.set(idThread, {
						'reason': data.data.reason || '',
						'dateAdded': data.data.dateAdded || ''
					});
				}
				if (data.data && data.data.commandBanned && data.data.commandBanned.length !== 0) {
					global.data.commandBanned.set(idThread, data.data.commandBanned);
				}
				if (data.data && data.data.NSFW) {
					global.data.threadAllowNSFW.push(idThread);
				}
			});
			users.forEach(dataU => {
				const idUsers = String(dataU.userID);
				global.data.allUserID.push(idUsers);
				if (dataU.name && dataU.name.length !== 0) {
					global.data.userName.set(idUsers, dataU.name);
				}
				if (dataU.data && dataU.data.banned) {
					global.data.userBanned.set(idUsers, {
						'reason': dataU.data.reason || '',
						'dateAdded': dataU.data.dateAdded || ''
					});
				}
				if (dataU.data && dataU.data.commandBanned && dataU.data.commandBanned.length !== 0) {
					global.data.commandBanned.set(idUsers, dataU.data.commandBanned);
				}
			});
			global.loading(`loaded ${chalk.blueBright(`${global.data.allThreadID.length}`)} groups and ${chalk.blueBright(`${global.data.allUserID.length}`)} users\n\n${sky(`
\u2588\u2584\u2580\u2003\u2588\u2591\u2588\u2003\u2588\u2580\u2003\u2588\u2591\u2588\u2003\u2584\u2580\u2588\u2003\u2588\u2591\u2591\n\u2588\u2591\u2588\u2003\u2588\u2584\u2588\u2003\u2584\u2588\u2003\u2588\u2580\u2588\u2003\u2588\u2580\u2588\u2003\u2588\u2584\u2584 \n\x4d\x61\x64\x65\x20\x42\x79\x20\x4b\x75\x73\x68\x61\x6c\x20\x54\x68\x61\x70\x61`)}\n`, "Database");
		} catch (error) {
			logger.loader(`can't load environment variable, error : ${error}`, 'error');
		}
	})();	
	global.loading(`${sky(``)}\x4b\x75\x73\x68\x61\x6c\x20\x54\x68\x61\x70\x61\n${sky(`Bot name -`)} ${(!global.config.BOTNAME) ? "kushal" : global.config.BOTNAME} \n${sky(`Bot id -`)} ${api.getCurrentUserID()} \n${sky(`Bot Prefix -`)} ${global.config.PREFIX}`, "\x4f\x77\x6e\x65\x72");
	
